INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', 'Bệnh viện Hữu nghị Việt Đức', '<h2>GIỚI THIỆU</h2>\n<p><strong>Địa chỉ:</strong>  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<ul>\n<li>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</li>\n</ul>\n<p><strong>Thời gian làm việc:</strong> Thứ 2 đến thứ 7</p>\n<ul>\n<li>\n<p>Sáng: 7h00 - 12h00</p>\n</li>\n<li>\n<p>Chiều: 13h30 - 16h30</p>\n</li>\n</ul>\n<p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>\n<p>Bệnh viện có nhiều khu khám bệnh, hiện tại BookingCare đang hỗ trợ đăng ký khám tại tòa nhà C4 - Khoa khám bệnh theo yêu cầu. Người bệnh đến khám đúng tòa nhà C4 để được hỗ trợ.</p>\n</li>\n<li>\n<p>Bệnh viện chuyên về Ngoại khoa nên lịch của các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.</p>\n</li>\n<li>\n<p>Mỗi bệnh nhân trong ngày chỉ được đặt trước 1 chuyên khoa, nếu đăng kí 2 chuyên khoa trở lên sẽ trao đổi bác sĩ thăm khám ban đầu chuyển khám thêm khoa khác.</p>\n</li>\n</ul>\n', '\n## GIỚI THIỆU\n\n\n**Địa chỉ:**  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\n* Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc:** Thứ 2 đến thứ 7\n\n* Sáng: 7h00 - 12h00\n\n* Chiều: 13h30 - 16h30\n\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n**Lưu ý quan trọng**\n\n* Bệnh viện có nhiều khu khám bệnh, hiện tại BookingCare đang hỗ trợ đăng ký khám tại tòa nhà C4 - Khoa khám bệnh theo yêu cầu. Người bệnh đến khám đúng tòa nhà C4 để được hỗ trợ.\n\n* Bệnh viện chuyên về Ngoại khoa nên lịch của các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\n\n* Mỗi bệnh nhân trong ngày chỉ được đặt trước 1 chuyên khoa, nếu đăng kí 2 chuyên khoa trở lên sẽ trao đổi bác sĩ thăm khám ban đầu chuyển khám thêm khoa khác.', , '2024-02-22 15:32:07', '2024-02-22 15:32:07');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(3, '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'Bệnh viện Chợ Rẫy', '<h2>GIỚI THIỆU</h2>\n<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p><strong>Địa chỉ bệnh viện:</strong></p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>\n<p>Thứ 2 đến thứ 6: từ 7h – 16h</p>\n</li>\n<li>\n<p>Thứ 7: từ 7h – 11h</p>\n</li>\n</ul>', '\n## GIỚI THIỆU\n\nBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\n**Địa chỉ bệnh viện:**\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\n**Thời gian làm việc:**\n\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\n* Thứ 2 đến thứ 6: từ 7h – 16h\n\n* Thứ 7: từ 7h – 11h', , '2024-02-22 15:39:31', '2024-02-22 15:39:31');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(4, '429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh ', 'Doctor Check - Tầm Soát Bệnh Để Sống Thọ Hơn', '<h2>GIỚI THIỆU CHUNG</h2>\n<p>Doctor Check tự hào là Trung tâm Nội soi Tiêu hoá được Sở Y tế cấp phép đạt chuẩn thực hiện nội soi tiêu hoá “không đau”.</p>\n<p>Trung tâm nội soi và chẩn đoán bệnh lý tiêu hoá Doctor Check là đơn vị chuyên sâu về nội soi tiêu hóa, 100% Bác sĩ Nội soi tại Doctor Check được tập huấn chuyên sâu về nội soi chẩn đoán bệnh lý ống tiêu hoá và tầm soát ung thư sớm của ống tiêu hóa.</p>\n<p>Trung tâm còn trang bị đầu tư các loại máy móc tiên tiến, ứng dụng trí tuệ nhân tạo (AI) giúp phát hiện các tổn thương chỉ là nhỏ nhất và hỗ trợ bác sĩ có thể chẩn đoán bệnh hiệu quả. Trung tâm không chỉ đầu tư về các loại máy nội soi mà còn trang bị các loại máy móc hỗ trợ khác trong toàn bộ quá trình khám của bệnh nhân như: Máy chụp Xquang, siêu âm hiện đại, Hệ thống máy xét nghiệm tự động,...</p>\n<p>Như vậy, đây là địa chỉ thăm khám và điều trị chuyên sâu về bệnh lý tiêu hóa, phù hợp với người bệnh có nhu cầu khám chuyên sâu về các mặt bệnh này.</p>\n<p><strong>Địa chỉ:</strong> 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<ul>\n<li>\n<p>Thứ 2 - Thứ 7: 6h00 - 15h00</p>\n</li>\n<li>\n<p>Chủ nhật: 7h00 - 12h00</p>\n</li>\n</ul>\n<p><strong>Hình thức thanh toán:</strong></p>\n<p>Phòng khám có thanh toán bằng hình thức Quẹt thẻ, Tiền mặt, Chuyển khoản, Bảo hiểm tư nhân</p>\n', '\n## GIỚI THIỆU CHUNG\n\nDoctor Check tự hào là Trung tâm Nội soi Tiêu hoá được Sở Y tế cấp phép đạt chuẩn thực hiện nội soi tiêu hoá “không đau”.\n\nTrung tâm nội soi và chẩn đoán bệnh lý tiêu hoá Doctor Check là đơn vị chuyên sâu về nội soi tiêu hóa, 100% Bác sĩ Nội soi tại Doctor Check được tập huấn chuyên sâu về nội soi chẩn đoán bệnh lý ống tiêu hoá và tầm soát ung thư sớm của ống tiêu hóa.\n\nTrung tâm còn trang bị đầu tư các loại máy móc tiên tiến, ứng dụng trí tuệ nhân tạo (AI) giúp phát hiện các tổn thương chỉ là nhỏ nhất và hỗ trợ bác sĩ có thể chẩn đoán bệnh hiệu quả. Trung tâm không chỉ đầu tư về các loại máy nội soi mà còn trang bị các loại máy móc hỗ trợ khác trong toàn bộ quá trình khám của bệnh nhân như: Máy chụp Xquang, siêu âm hiện đại, Hệ thống máy xét nghiệm tự động,...\n\nNhư vậy, đây là địa chỉ thăm khám và điều trị chuyên sâu về bệnh lý tiêu hóa, phù hợp với người bệnh có nhu cầu khám chuyên sâu về các mặt bệnh này.\n\n**Địa chỉ:** 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh \n\n**Thời gian làm việc:** \n\n* Thứ 2 - Thứ 7: 6h00 - 15h00\n\n* Chủ nhật: 7h00 - 12h00\n\n**Hình thức thanh toán:**\n\nPhòng khám có thanh toán bằng hình thức Quẹt thẻ, Tiền mặt, Chuyển khoản, Bảo hiểm tư nhân', , '2024-02-22 15:41:41', '2024-02-22 15:41:41');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(5, '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', 'Phòng khám Bệnh viện Đại học Y Dược 1', '<h2>GIỚI THIỆU</h2>\n<p>Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p>\n<p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.</p>\n<p>Hơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.</p>\n<p><strong>Địa chỉ:</strong> 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong></p>\n<ul>\n<li>\n<p>Thứ 2 tới thứ 6: 07h30 - 16h30</p>\n</li>\n<li>\n<p>Thứ 7: 07h30 - 12h00</p>\n</li>\n</ul>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>\n<p>Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau.</p>\n</li>\n<li>\n<p>Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.</p>\n</li>\n</ul>\n', '\n## GIỚI THIỆU\n\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.\n\nCác bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.\n\nHơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.\n\n**Địa chỉ:** 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\n**Thời gian làm việc**\n\n* Thứ 2 tới thứ 6: 07h30 - 16h30\n\n* Thứ 7: 07h30 - 12h00\n\n**Lưu ý quan trọng**\n\n* Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau.\n\n \n* Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.', , '2024-02-22 15:43:28', '2024-02-22 15:43:28');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(6, 'Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội', 'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', '<h2>GIỚI THIỆU</h2>\n<p><strong>Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108</strong> là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.</p>\n<p>Vì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:</p>\n<ul>\n<li>\n<p>Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.</p>\n</li>\n<li>\n<p>Được khám với quy trình khép kín, không phải di chuyển nhiều.</p>\n</li>\n<li>\n<p>Được tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.</p>\n</li>\n<li>\n<p>Khu vực khám riêng tư, lịch sự.</p>\n</li>\n<li>\n<p>Được lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.</p>\n</li>\n<li>\n<p>Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.</p>\n</li>\n</ul>\n<p><strong>Địa chỉ:</strong> Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<ul>\n<li>\n<p>6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)</p>\n</li>\n<li>\n<p>Khám cá nhân: Thứ 2 - Thứ 6</p>\n</li>\n<li>\n<p>Khám đoàn và công ty: Thứ 7</p>\n</li>\n</ul>\n', '\n## GIỚI THIỆU\n\n**Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108** là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.\n\nVì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:\n\n* Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\n\n* Được khám với quy trình khép kín, không phải di chuyển nhiều.\n\n* Được tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\n\n* Khu vực khám riêng tư, lịch sự.\n\n* Được lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\n\n* Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\n\n**Địa chỉ:** Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108\n\n**Thời gian làm việc:**\n\n* 6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\n\n* Khám cá nhân: Thứ 2 - Thứ 6\n\n* Khám đoàn và công ty: Thứ 7', , '2024-02-22 15:46:04', '2024-02-22 15:46:04');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(7, 'Số 29 Nguyễn Bỉnh Khiêm, Hai Bà Trưng, Hà Nội ', 'Bệnh viện Y học cổ truyền Trung ương', '<h2>GIỚI THIỆU</h2>\n<p><strong>Địa chỉ:</strong> 29 Nguyễn Bỉnh Khiêm, Nguyễn Du, Hai Bà Trưng, Hà Nội</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<ul>\n<li>\n<p>Khoa khám bệnh làm việc cả ngày từ Thứ 2 - Thứ 6</p>\n</li>\n<li>\n<p>Từ 7h00 - 16h00 (người bệnh nên đăng ký khám trước 15h00)</p>\n</li>\n</ul>\n<p>Bệnh viện Y học Cổ truyền Trung ương là bệnh viện đầu ngành về Y học cổ truyền - Trung tâm hợp tác về y học cổ truyền của Tổ chức Y tế thế giới tại Việt Nam. Bệnh viện có 34 khoa phòng và trung tâm được chia thành 4 khối: lâm sàng, cận lâm sàng, các trung tâm và khối các phòng ban chức năng.</p>\n<p>Bệnh viện có các khoa lâm sàng Nội, Ngoại, Phụ, Nội Nhi, Châm cứu dưỡng sinh, Lão, Hồi sức cấp cứu,  Da liễu, Kiểm soát và Điều trị Ung bướu, Khám chữa bệnh tự nguyện chất lượng cao, Khoa khám bệnh, Khoa thận tiết niệu và nam học, Khoa đa khoa ngũ quan, Khoa cơ xương khớp; với đầy đủ các trang thiết bị hiện đại để phục vụ cho chẩn đoán, điều trị và nghiên cứu khoa học.</p>\n<p>Bệnh nhân được trực tiếp khám chữa bệnh là các Giáo sư, Phó giáo sư, Tiến sĩ, Thạc sĩ, BSCKI, BSCKII có chuyên môn cao, nhiều năm kinh nghiệm, là các chuyên gia đầu ngành trong lĩnh vực YHCT.</p>\n', '\n## GIỚI THIỆU\n\n**Địa chỉ:** 29 Nguyễn Bỉnh Khiêm, Nguyễn Du, Hai Bà Trưng, Hà Nội\n\n**Thời gian làm việc:**\n\n* Khoa khám bệnh làm việc cả ngày từ Thứ 2 - Thứ 6\n\n* Từ 7h00 - 16h00 (người bệnh nên đăng ký khám trước 15h00)\n\nBệnh viện Y học Cổ truyền Trung ương là bệnh viện đầu ngành về Y học cổ truyền - Trung tâm hợp tác về y học cổ truyền của Tổ chức Y tế thế giới tại Việt Nam. Bệnh viện có 34 khoa phòng và trung tâm được chia thành 4 khối: lâm sàng, cận lâm sàng, các trung tâm và khối các phòng ban chức năng.\n\nBệnh viện có các khoa lâm sàng Nội, Ngoại, Phụ, Nội Nhi, Châm cứu dưỡng sinh, Lão, Hồi sức cấp cứu,  Da liễu, Kiểm soát và Điều trị Ung bướu, Khám chữa bệnh tự nguyện chất lượng cao, Khoa khám bệnh, Khoa thận tiết niệu và nam học, Khoa đa khoa ngũ quan, Khoa cơ xương khớp; với đầy đủ các trang thiết bị hiện đại để phục vụ cho chẩn đoán, điều trị và nghiên cứu khoa học.\n\nBệnh nhân được trực tiếp khám chữa bệnh là các Giáo sư, Phó giáo sư, Tiến sĩ, Thạc sĩ, BSCKI, BSCKII có chuyên môn cao, nhiều năm kinh nghiệm, là các chuyên gia đầu ngành trong lĩnh vực YHCT.', , '2024-02-22 15:50:22', '2024-02-22 15:50:22');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(8, '414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh', 'Trung tâm xét nghiệm Diag Laboratories', '<h2>GIỚI THIỆU CHUNG</h2>\n<p>Diag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.</p>\n<ul>\n<li>\n<p>Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.</p>\n</li>\n<li>\n<p>Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.</p>\n</li>\n<li>\n<p>Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.</p>\n</li>\n<li>\n<p>Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</p>\n</li>\n<li>\n<p>Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.</p>\n</li>\n</ul>\n<p>Trung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.</p>\n<p><strong>Địa chỉ:</strong> Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh</p>\n<p>Trung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p><strong>Giờ mở cửa:</strong></p>\n<ul>\n<li>6h00 mỗi ngày</li>\n</ul>\n<p><strong>Giờ đóng cửa:</strong></p>\n<ul>\n<li>\n<p>Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)</p>\n</li>\n<li>\n<p>Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00</p>\n</li>\n</ul>\n<p><strong>Hình thức thanh toán:</strong></p>\n<ul>\n<li>\n<p>Trung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ</p>\n</li>\n<li>\n<p>Trung tâm có xuất hóa đơn đỏ trong vòng 24 giờ</p>\n</li>\n</ul>\n', '\n## GIỚI THIỆU CHUNG\n\nDiag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.\n\n* Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.\n\n* Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.\n\n* Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.\n\n* Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n\n* Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.\n\nTrung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.\n\n**Địa chỉ:** Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh\n\nTrung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n\n**Thời gian làm việc:** \n\n**Giờ mở cửa:**\n \n* 6h00 mỗi ngày\n\n**Giờ đóng cửa:** \n* Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)\n\n* Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00\n\n**Hình thức thanh toán:** \n\n* Trung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ\n\n* Trung tâm có xuất hóa đơn đỏ trong vòng 24 giờ', , '2024-02-22 15:54:49', '2024-02-22 15:54:49');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHtml`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(9, 'Số 1E Trường Chinh - Thanh Xuân - Hà Nội', 'Bệnh viện Đa khoa An Việt', '<h2>GIỚI THIỆU</h2>\n<p>Bệnh viện An Việt là bệnh viện đa khoa tư nhân đã hoạt động được trên 10 năm. Bệnh viện là địa chỉ khám và điều trị uy tín về một số mặt bệnh chuyên khoa như Tai Mũi Họng, Thần kinh, Sản phụ khoa, Nam khoa,...</p>\n<p>Đội ngũ bác sĩ của bệnh viện đều là các bác sĩ nhiều năm kinh nghiệm và được bệnh nhân phản hồi tích cực về quá trình khám và điều trị. Bên cạnh đó, bệnh viện còn đầu tư cơ sở hạ tầng và trang thiết bị hỗ trợ thăm khám và điều trị hiệu quả cho người bệnh: Hệ thống nội soi tai mũi họng, máy chụp cắt lớp vi tính, phòng phẫu thuật đảm bảo vô trùng,...</p>\n<p><strong>Địa chỉ:</strong> Số 1E Trường Chinh, Thanh Xuân, Hà Nội</p>\n<p><strong>Thời gian làm việc:</strong> Thứ 2 đến Chủ Nhật</p>\n<ul>\n<li>\n<p>Sáng: Từ 7h30 – 12h00</p>\n</li>\n<li>\n<p>Chiều: Từ 13h30 – 16h30</p>\n</li>\n</ul>\n<p><strong>Hình thức thanh toán:</strong> Tiền mặt, Thẻ ngân hàng</p>\n<p><strong>Bảo hiểm bảo lãnh:</strong> Hiện tại, bệnh viện hỗ trợ thanh toán bảo hiểm y tế nhà nước với các danh mục cho phép và bảo lãnh trực tiếp nhiều loại bảo hiểm y tế tư nhân như: Insmart, VIB, PTI, Baoviet,...</p>\n', '\n## GIỚI THIỆU\n\nBệnh viện An Việt là bệnh viện đa khoa tư nhân đã hoạt động được trên 10 năm. Bệnh viện là địa chỉ khám và điều trị uy tín về một số mặt bệnh chuyên khoa như Tai Mũi Họng, Thần kinh, Sản phụ khoa, Nam khoa,...\n\nĐội ngũ bác sĩ của bệnh viện đều là các bác sĩ nhiều năm kinh nghiệm và được bệnh nhân phản hồi tích cực về quá trình khám và điều trị. Bên cạnh đó, bệnh viện còn đầu tư cơ sở hạ tầng và trang thiết bị hỗ trợ thăm khám và điều trị hiệu quả cho người bệnh: Hệ thống nội soi tai mũi họng, máy chụp cắt lớp vi tính, phòng phẫu thuật đảm bảo vô trùng,...\n\n**Địa chỉ:** Số 1E Trường Chinh, Thanh Xuân, Hà Nội\n\n**Thời gian làm việc:** Thứ 2 đến Chủ Nhật\n\n* Sáng: Từ 7h30 – 12h00\n\n* Chiều: Từ 13h30 – 16h30\n\n**Hình thức thanh toán:** Tiền mặt, Thẻ ngân hàng\n\n**Bảo hiểm bảo lãnh:** Hiện tại, bệnh viện hỗ trợ thanh toán bảo hiểm y tế nhà nước với các danh mục cho phép và bảo lãnh trực tiếp nhiều loại bảo hiểm y tế tư nhân như: Insmart, VIB, PTI, Baoviet,...', , '2024-02-22 15:57:42', '2024-02-22 15:57:42');

