INSERT INTO `handbooks` (`id`, `name`, `contentHtml`, `contentHandbook`, `description`, `createdAt`, `updatedAt`) VALUES
(7, '4 giai đoạn của bệnh thoái hóa cột sống thắt lưng và phương pháp điều trị', '<h2>Các giai đoạn của bệnh thoái hóa cột sống thắt lưng và phương pháp điều trị</h2>\n<hr>\n<h3>Giai đoạn 1</h3>\n<p>Giai đoạn đầu, bệnh nhân mắc bệnh thoái hóa cột sống lưng không cảm thấy đau. Tuy nhiên, các bộ phận như: khớp, đĩa đệm,… lão hóa sẽ chịu ảnh hưởng lớn từ áp lực xung quanh vùng cột sống do đường cong sinh lý của cột sống bị biến đổi.\nNgười bệnh có biểu hiện yếu cơ hai chân, mất thăng bằng khả năng vận động bị hạn chế do cột sống thắt lưng bị biến dạng trong khi không có biểu hiện viêm.\nPhương pháp điều trị: Bệnh nhân ở giai đoạn này nên vận động nhẹ nhàng, tránh việc vận động mạnh sẽ khiến cột sống lưng dễ bị tổn thương và gây ra tình trạng nặng hơn. Trong hoạt động hằng ngày, tránh mang vác vật nặng, cúi lưng nhiều hay đứng một chỗ quá lâu vì sẽ ảnh hưởng đến các khối cơ, dây thần kinh và ống xương, đẩy nhanh quá trình lão hóa và làm giảm sự dẻo dai của xương, các mô có liên quan.</p>\n<p><img src=\"https://github.com/Dung-Pham/HealthCare-img/blob/main/img/bai1/th.jpg?raw=true\" alt=\"img\"></p>\n<p>Thoái hóa cột sống thắt lưng là bệnh thường gặp. Nếu nắm được các giai đoạn của bệnh sẽ giúp bạn có hướng điều trị và phòng bệnh hiệu quả.</p>\n<h3>Giai đoạn 2</h3>\n<p>Do ống sống hẹp hơn, tầm vận động của các khớp bị hạn chế nên tư thế đứng của bệnh nhân sẽ có sự thay đổi và chiều cao sẽ giảm. Cột sống lưng ở giai đoạn này sẽ gặp các biến chứng như: hẹp đĩa đệm, thoát vị đĩa đệm, gai cột sống.\nBệnh nhân ở giai đoạn này dễ xảy ra tình trạng căng thẳng, mệt mỏi do những cơn đau nhức thường xuyên kéo dài. Cường độ của cơn đau xương khớp sẽ tăng lên khi vận động và giảm đi khi bệnh nhân nghỉ ngơi hay khi thời tiết thay đổi.\nPhương pháp điều trị: để đạt hiệu quả cao trong quá trình điều trị, bệnh nhân cần sử dụng phương pháp &quot;bảo tồn&quot; (không can thiệp vào cột sống). Phương pháp này bao gồm các biện pháp điều trị như: vật lý trị liệu, trị liệu thần kinh cột sống, chiếu tia hồng ngoại, tập cơ dựng lưng,…nhằm hạn chế tình trạng hẹp đĩa đệm, gai cột sống giúp bệnh nhân khôi phục khả năng vận động, cải thiện các vấn đề hạn chế tư thế đứng và ảnh hưởng các mô cơ quan, chèn ép sống tủy gây hẹp ống sống.</p>\n<h3>Giai đoạn 3</h3>\n<p>Bệnh nhân bị thoái hóa cột sống lưng sẽ gặp tình trạng hạn chế trong chuyển động, mất cân bằng, cong xương sống hay thậm chí là biến dạng xương nghiêm trọng. Giai đoạn này là giai đoạn bệnh lý chuyển sang tình trạng nặng hơn trong nhiều năm. Hậu quả là các dây thần kinh bị tổn thương nặng nề, cơ thể thiếu năng lượng và giảm chiều cao so với thông thường.\nPhương pháp điều trị: Bệnh nhân ở giai đoạn này nên sử dụng các loại thuốc điều trị thoái hóa cột sống lưng thông qua tư vấn từ bác sĩ chuyên khoa. Việc sử dụng thuốc điều trị nhằm giãn cơ, giảm đau và làm giảm các triệu chứng bệnh chứ không thể điều trị dứt điểm. Ngoài thuốc tây, các bài thuốc đông và nam y cũng là bài thuốc hỗ trợ hiệu quả trong quá trình điều trị bệnh thoái hóa cột sống lưng.</p>\n<h3>Giai đoạn 4</h3>\n<p>Các tình trạng mà bệnh nhân gặp ở 3 giai đoạn trước đó sẽ chuyển sang tổn thương vĩnh viễn. Thậm chí, do dây thần kinh chèn ép lâu ngày khiến nhiều bệnh nhân bị teo cơ, gây biến dạng cột sống nghiêm trọng ở giai đoạn này.\nBệnh nhân bị đau vùng lưng dưới, lan xuống hai chân và mông làm người bệnh không cúi xuống được, yếu ở chân hoặc tay, sự phối hợp giữa tay và chân kém. Thậm chí, người bệnh còn có thể nghe thấy tiếng lục cục khi vận động, đứng lên hay ngồi xuống ở cột sống lưng, nhất là khi xoay người. Bệnh nhân ở giai đoạn này có thể gặp những biến chứng nguy hiểm như bại chân hay tàn phế.\nPhương pháp điều trị: Phẫu thuật là phương pháp điều trị giúp giải quyết cơn đau và cải thiện bệnh lý một cách nhanh chóng. Tuy nhiên, mức chi phí để thực hiện phẫu thuật không hề rẻ, cùng với đó là nguy cơ tái phát thoái hóa nếu sinh hoạt không khoa học và những biến chứng mà người bệnh có thể phải đối mặt như: nhiễm trùng vết mổ, tăng nguy cơ tổn thương mô mềm xung quanh khu vực mổ… Vì vậy, thông qua nhận định của các bác sĩ chuyên môn, phẫu thuật cột sống lưng chỉ dành cho trường hợp nặng như: hẹp ống tủy chèn ép tủy sống, chèn ép rễ thần kinh,… ảnh hưởng trầm trọng đến việc vận động bình thường của bệnh nhân.</p>\n<p>Hạn chế bệnh lý này việc phòng ngừa thoái hóa cột sống lưng một cách hiệu quả.\n<img src=\"https://github.com/Dung-Pham/HealthCare-img/blob/main/img/bai1/thoai-hoa-cot-song-170840286186910630994.jpg?raw=true\" alt=\"img\"></p>\n<h3>Cách ngăn ngừa thoái hóa cột sống</h3>\n<p>Trên thị trường hiện nay chưa có thuốc trị liệu dứt điểm bệnh thoái hóa cột sống lưng. Vì thế, để hạn chế bệnh lý này việc phòng ngừa thoái hóa cột sống lưng một cách hiệu quả rất quan trọng, gồm:</p>\n<ul>\n<li>Xây dựng chế độ dinh dưỡng hợp lý: Cần bổ sung những thực phẩm giàu vitamin D, canxi, chất xơ và khoáng chất nhằm phòng ngừa bệnh thoái hóa cột sống, giúp cơ thể đào thải những độc tố và là giải pháp hữu hiệu giúp xương khớp chắc khỏe, dẻo dai.</li>\n<li>Hạn chế sử dụng các loại đồ ăn nhanh, đồ uống có ga, có cồn, các loại thịt đỏ, thuốc lá,…Tăng cường các loại trái cây, rau, củ giàu vitamin C để tăng sức đề kháng, chống viêm, chống chất oxy hóa cho cơ thể.</li>\n<li>Rèn luyện thể thao thường xuyên và duy trì tập luyện hàng ngày để hỗ trợ trao đổi chất, giảm bớt áp lực tác động lên xương khớp, giúp các cơ được giãn ra, cải thiện chức năng vận động.</li>\n<li>Thay đổi các tư thế sinh hoạt: tư thế ăn uống, học tập, đi, đứng, khuân vác vật nặng,…giúp làm chậm quá trình lão hóa của xương khớp và tránh tổn thương cột sống lưng.</li>\n<li>Ngủ đủ giấc.</li>\n<li>Tránh căng thẳng và stress</li>\n<li>Áp dụng các biện pháp giảm đau tại nhà: massage, chườm lạnh, chườm nóng,… nhằm khắc phục cơn đau ngay tại nhà, giúp các cơ co giãn, hồi phục sau quá trình vận động.</li>\n</ul>\n', '\n## Các giai đoạn của bệnh thoái hóa cột sống thắt lưng và phương pháp điều trị\n---\n\n### Giai đoạn 1\n\nGiai đoạn đầu, bệnh nhân mắc bện