(1, '<h3><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Đoàn Thế Anh</strong></h3>\n<ul>\n<li>\n<p>Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</p>\n</li>\n<li>\n<p>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</p>\n</li>\n<li>\n<p>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</p>\n</li>\n<li>\n<p>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</p>\n</li>\n<li>\n<p>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</p>\n</li>\n<li>\n<p>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</p>\n</li>\n<li>\n<p>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</p>\n</li>\n<li>\n<p>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</p>\n</li>\n<li>\n<p>Tốt nghiệp Đại học Y Hà Nội (1977)</p>\n</li>\n<li>\n<p>Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam</p>\n</li>\n</ul>\n<h3><strong>Phó Giáo sư khám và điều trị</strong></h3>\n<p>Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</p>\n<ul>\n<li>\n<p>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)</p>\n</li>\n<li>\n<p>Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá</p>\n</li>\n<li>\n<p>Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da</p>\n</li>\n<li>\n<p>Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm</p>\n</li>\n<li>\n<p>Viêm da cơ địa trẻ em và người lớn</p>\n</li>\n<li>\n<p>Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu</p>\n</li>\n<li>\n<p>Tổ đỉa</p>\n</li>\n<li>\n<p>Mày đay</p>\n</li>\n<li>\n<p>Bạch biến</p>\n</li>\n<li>\n<p>Vảy nến</p>\n</li>\n<li>\n<p>Rụng tóc</p>\n</li>\n<li>\n<p>Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ</p>\n</li>\n<li>\n<p>Zona, Thủy đậu, Herpes</p>\n</li>\n<li>\n<p>Ghẻ</p>\n</li>\n<li>\n<p>Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc</p>\n</li>\n<li>\n<p>Viêm mao mạch dị ứng</p>\n</li>\n<li>\n<p>các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc</p>\n</li>\n<li>\n<p>U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã</p>\n</li>\n<li>\n<p>Một số bệnh lông - tóc - móng</p>\n</li>\n<li>\n<p>Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi</p>\n</li>\n<li>\n<p>Tiêm tái sinh nang tóc</p>\n</li>\n</ul>\n<p><strong>Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu</strong></p>\n', '\n### **Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Đoàn Thế Anh**\n\n\n* Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu\n\n* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\n\n* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\n\n* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\n\n* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\n\n* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới\n\n* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\n\n* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ\n\n* Tốt nghiệp Đại học Y Hà Nội (1977)\n\n* Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam\n\n\n\n###  **Phó Giáo sư khám và điều trị**\n\n\n\n Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em\n\n* Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)\n\n* Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá\n\n* Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da\n* Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm\n\n* Viêm da cơ địa trẻ em và người lớn\n\n* Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu\n\n* Tổ đỉa\n\n* Mày đay\n\n* Bạch biến\n\n* Vảy nến\n\n* Rụng tóc\n\n* Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ\n\n* Zona, Thủy đậu, Herpes\n\n* Ghẻ\n\n* Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc\n\n* Viêm mao mạch dị ứng\n\n* các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc\n\n* U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã\n\n* Một số bệnh lông - tóc - móng\n\n* Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi\n\n* Tiêm tái sinh nang tóc\n\n**Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu**', 'Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nNguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam', 30, NULL, NULL, '2023-09-26 16:13:41', '2023-09-26 17:30:30'),
(2, '<p><strong>Bác sĩ Chuyên khoa II Nguyễn Tiến Anh</strong></p>\n<ul>\n<li>\n<p>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám từ 16 tuổi trở lên</p>\n</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</p>\n</li>\n<li>\n<p>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>\n<p>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</p>\n</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>\n<p>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</p>\n</li>\n<li>\n<p>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</p>\n</li>\n<li>\n<p>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</p>\n</li>\n<li>\n<p>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</p>\n</li>\n<li>\n<p>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</p>\n</li>\n<li>\n<p>Rối loạn ảo giác</p>\n</li>\n<li>\n<p>Các rối loạn liên quan đến stress</p>\n</li>\n<li>\n<p>Rối loạn khí sắc</p>\n</li>\n<li>\n<p>Rối loạn cảm xúc phân liệt</p>\n</li>\n<li>\n<p>Rối loạn đa nhân cách</p>\n</li>\n<li>\n<p>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</p>\n</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Nguyễn Tiến Anh**\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n**Quá trình đào tạo**\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n**Quá trình công tác**\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n**Khám và điều trị**\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n\n* Rối loạn ảo giác\n\n* Các rối loạn liên quan đến stress\n\n* Rối loạn khí sắc\n\n* Rối loạn cảm xúc phân liệt\n\n* Rối loạn đa nhân cách\n\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 29, NULL, NULL, '2023-09-26 17:19:39', '2023-10-14 14:46:57'),
